INSERT INTO `pages` (`id`, `slug`, `title`, `title_en`, `title_bn`, `subtitle`, `subtitle_en`, `subtitle_bn`, `description`, `description_en`, `description_bn`, `thumb`, `photo`, `gallery`, `meta_keys`, `meta_keys_bn`, `meta_keys_en`, `meta_desc`, `meta_desc_en`, `meta_desc_bn`, `default`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'home', '{\"en\":\"home\",\"bn\":\"হোম\"}', 'home', 'হোম', '{\"en\":\"Gk Restaurant\",\"bn\":\"জামান ডিপার্টমেন্টাল স্টোর\"}', 'Gk Restaurant', 'জামান ডিপার্টমেন্টাল স্টোর', '{\"en\":\"<p>Welcome to Gk Restaurant. It is the online version of the Restaurant for the people living within 2\\/3 miles radious from the location. You can place order online using this website. Whether you order for yourself or to send to someone else,  we are ready to deliver straight to yours - or someone else\'s door.<\\/p>\\r\\n\\r\\n<p>Our website design  and content are very simple. Choose the products you want to order by visiting the order page. You can browse by category or search for particular products.<\\/p>\\r\\n\\r\\n\\r\\n<p>Still if you have any problem, you just  ring us during shop opening hours and we\'ll do everything to help you.<\\/p>\\r\\n\\r\\n<p>Hope, you will enjoy our products and services equally very much. If you have any questions, comments, or objection, please don\'t hesitate to <a class=\\\"w3-border-bottom\\\" href=\\\"\\/contact\\\">contact us<\\/a>.<\\/p>\",\"bn\":\"<p>Welcome to Gk Restaurant. It is the online version of the Restaurant for the people living within 2\\/3 miles radious from the location. You can place order online using this website. Whether you order for yourself or to send to someone else,  we are ready to deliver straight to yours - or someone else\'s door.<\\/p>\\r\\n\\r\\n<p>Our website design  and content are very simple. Choose the products you want to order by visiting the order page. You can browse by category or search for particular products.<\\/p>\\r\\n\\r\\n\\r\\n<p>Still if you have any problem, you just  ring us during shop opening hours and we\'ll do everything to help you.<\\/p>\\r\\n\\r\\n<p>Hope, you will enjoy our products and services equally very much. If you have any questions, comments, or objection, please don\'t hesitate to <a class=\\\"w3-border-bottom\\\" href=\\\"\\/contact\\\">contact us<\\/a>.<\\/p>\"}', '<p>Welcome to Gk Restaurant. It is the online version of the Restaurant for the people living within 2/3 miles radious from the location. You can place order online using this website. Whether you order for yourself or to send to someone else,  we are ready to deliver straight to yours - or someone else\'s door.</p>\r\n\r\n<p>Our website design  and content are very simple. Choose the products you want to order by visiting the order page. You can browse by category or search for particular products.</p>\r\n\r\n\r\n<p>Still if you have any problem, you just  ring us during shop opening hours and we\'ll do everything to help you.</p>\r\n\r\n<p>Hope, you will enjoy our products and services equally very much. If you have any questions, comments, or objection, please don\'t hesitate to <a class=\"w3-border-bottom\" href=\"/contact\">contact us</a>.</p>', '<p>জামান ডিপার্টমেন্টাল স্টোর এ আপনাকে স্বাগত। এটি দোকানের অবস্থান থেকে ২/৩ কিলোমিটারের অভ্যন্তরে বসবাসকারী লোকদের জন্য জামান ডিপার্টমেন্টাল স্টোর এর অনলাইন সংস্করণ। আপনি এই ওয়েবসাইটটি ব্যবহার করে  আমাদের স্টোরে সরাসরি অনলাইনে অর্ডার দিতে পারেন। আপনি নিজের জন্য অর্ডার দিন বা অন্য কারও কাছে প্রেরণ করার জন্য, আমরা সরাসরি আপনার - বা অন্যের দ্বারে পৌঁছে দিতে প্রস্তুত।</p>\r\n\r\n<p>আমাদের ওয়েবসাইট ডিজাইন এবং বিষয়বস্তু খুব সহজ। অর্ডার পৃষ্ঠাতে গিয়ে আপনি যে পণ্যগুলি অর্ডার করতে চান তা চয়ন করুন। আপনি ক্যাটাগরি অনুযায়ী ব্রাউজ করতে পারেন বা নির্দিষ্ট কোনো পণ্য অনুসন্ধান করতে পারেন।</p>\r\n\r\n</p>তবুও যদি আপনার কোনও সমস্যা থাকে তবে শপ খোলা থাকার সময় আমাদের ফোন দিন এবং আমরাই আপনাকে সহায়তা করার জন্য সব কিছু করব।</p>\r\n\r\n<p>আশা করি, আপনি আমাদের পণ্য এবং পরিষেবাগুলি সমানভাবে উপভোগ করবেন। আপনার যদি কোনও প্রশ্ন, মন্তব্য বা আপত্তি থাকে তবে দয়া করে আমাদের সাথে <a class=\"w3-border-bottom\" href=\"/contact\">যোগাযোগ</a> করতে দ্বিধা করবেন না।</p>', '20210316230346-31861.png', '20210316230346-31861.png', '', '{\"en\":\"Home, Demo shop Online\",\"bn\":\"Home, Demo shop Online\"}', 'Home, Demo shop Online', 'Home, Demo shop Online', '{\"en\":\"Home\",\"bn\":\"Home\"}', 'Home', 'Home', 0, 'active', '2020-07-22 19:48:01', '2021-07-01 16:28:09', 0),
