(3, 'contact', '{\"en\":\"contact\",\"bn\":\"কন্টাক্ট\"}', 'contact', 'কন্টাক্ট', '{\"en\":\"Please, let us know your concerns\",\"bn\":\"দয়া করে আমাদের আপনার উদ্বেগ জানান\"}', 'Please, let us know your concerns', 'দয়া করে আমাদের আপনার উদ্বেগ জানান', '{\"en\":\"If you have any problems or questions, fill out the form below and send it immediately.\",\"bn\":\"If you have any problems or questions, fill out the form below and send it immediately.\"}', 'If you have any problems or questions, fill out the form below and send it immediately.', 'আপনার কোনও সমস্যা বা প্রশ্ন থাকলে নীচের ফর্মটি পূরণ করে অবিলম্বে প্রেরণ করুন।', '20201218091216-57404.jpg', '20201218091216-57404.jpg', '', '{\"en\":\"get in touch,যোগাযোগ করুন \",\"bn\":\"Contact\"}', 'Contact', 'get in touch,যোগাযোগ করুন ', '{\"en\":\"We\'re here to help and answer any question you might have. We look forward to hearing from you.\",\"bn\":\"Contact\"}', 'We\'re here to help and answer any question you might have. We look forward to hearing from you.', 'Contact', 0, 'active', '2020-07-22 19:48:01', '2021-03-20 21:30:17', 0),
(4, 'gallery', '{\"en\":\"our gallary\",\"bn\":\"আমাদের গ্যালারী\"}', 'our gallary', 'আমাদের গ্যালারী', '{\"en\":\"A great way to share moments and memories\",\"bn\":\"মুহূর্ত এবং স্মৃতি ভাগ করে নেওয়ার দুর্দান্ত উপায়\"}', 'A great way to share moments and memories', 'মুহূর্ত এবং স্মৃতি ভাগ করে নেওয়ার দুর্দান্ত উপায়', '{\"en\":\"From the begining, we have captured some wonderful moments. We are very delighted to share these with our honorable customers. \",\"bn\":\"From the begining, we have captured some wonderful moments. We are very delighted to share these with our honorable customers. \"}', 'From the begining, we have captured some wonderful moments. We are very delighted to share these with our honorable customers. ', 'শুরু থেকেই, আমরা কিছু মনোরম মুহূর্ত ধারণ করেছি। আমরা সম্মানিত গ্রাহকদের সাথে এগুলি শেয়ার করতে পেরে অত্যন্ত আনন্দিত। ', '20201216141235-974365.jpg', '20201216141235-974365.jpg', '', '{\"en\":\"our gallary\",\"bn\":\"আমাদের গ্যালারী,আমরা আমাদের মনোরম মুহূর্তগুলি ভাগ করে নিতে ভালোবাসি\"}', 'আমাদের গ্যালারী,আমরা আমাদের মনোরম মুহূর্তগুলি ভাগ করে নিতে ভালোবাসি', 'our gallary', '{\"en\":\"From the begining, we have captured many wonderful moments. We are delighted to share these with our honorable customers.\",\"bn\":\"শুরু থেকেই, আমরা অনেক দুর্দান্ত মুহূর্তগুলি ধারণ করেছি। আমরা আমাদের সম্মানিত গ্রাহকদের সাথে এগুলি ভাগ করে নিতে পেরে আনন্দিত।\"}', 'From the begining, we have captured many wonderful moments. We are delighted to share these with our honorable customers.', 'শুরু থেকেই, আমরা অনেক দুর্দান্ত মুহূর্তগুলি ধারণ করেছি। আমরা আমাদের সম্মানিত গ্রাহকদের সাথে এগুলি ভাগ করে নিতে পেরে আনন্দিত।', 0, 'active', '2020-07-22 19:48:01', '2021-03-18 14:10:08', 0),
