ise your order. ', 'আপনার তথ্য পরীক্ষা করুন। আপনার যদি কোনও কুপন থাকে তবে আপনি কুপন কোড প্রয়োগ করতে পারেন। প্রয়োজনে অর্ডার সংক্রান্ত কোনও নোট সরবরাহ করুন। এবং অবশেষে আপনার অর্ডার চূড়ান্ত করতে বড় বোতাম টিপুন।', 0, 'active', '2020-07-22 19:48:01', '2021-04-03 18:51:46', 0),
(18, 'customer', '{\"en\":\"customer dashboard\",\"bn\":\"কাস্টমার ড্যাশবোর্ড \"}', 'customer dashboard', 'কাস্টমার ড্যাশবোর্ড ', '{\"en\":\"your private zone\",\"bn\":\"আপনার ব্যক্তিগত অঞ্চল\"}', 'your private zone', 'আপনার ব্যক্তিগত অঞ্চল', '{\"en\":\"Welcome to our Customer Dashboard. This is your private zone. You can update your account here. You will see a list of all your orders purchased from us. And learn about the progress of ongoing orders. In addition, you will be able to see how many royalty or reward points you have earned against all purchases so far.\",\"bn\":\"Welcome to our Customer Dashboard. This is your private zone. You can update your account here. You will see a list of all your orders purchased from us. And learn about the progress of ongoing orders. In addition, you will be able to see how many royalty or reward points you have earned against all purchases so far.\"}', 'Welcome to our Customer Dashboard. This is your private zone. You can update your account here. You will see a list of all your orders purchased from us. And learn about the progress of ongoing orders. In addition, you will be able to see how many royalty or reward points you have earned against all purchases so far.', 'আমাদের গ্রাহক ড্যাশবোর্ডে আপনাকে স্বাগতম। এটি আপনার ব্যক্তিগত অঞ্চল। আপনি এখানে আপনার অ্যাকাউন্ট আপডেট করতে পারবেন। আমাদের কাছ থেকে ক্রয় করা আপনার সমস্ত অর্ডার এর তালিকা দেখতে পারবেন। এবং চলমান অর্ডারের অগ্রগতি সম্পর্কে জানতে পারবেন । তদতিরিক্ত, আপনি এখন পর্যন্ত সমস্ত ক্রয়ের বিপরীতে আপনার যত রয়্যালটি বা রিওয়ার্ড পয়েন্ট অর্জন হয়েছে  তা দেখতে পারবেন । ', '20201222211219-792541.png', '20201222211219-792541.png', '', '{\"en\":\"Your private zone\",\"bn\":\"আপনার ব্যক্তিগত অঞ্চল\"}', 'আপনার ব্যক্তিগত অঞ্চল', 'Your private zone', '{\"en\":\"Your private zone\",\"bn\":\"আপনার ব্যক্তিগত অঞ্চল\"}', 'Your private zone', 'আপনার ব্যক্তিগত অঞ্চল', 0, 'active', '2020-07-22 19:48:01', '2021-02-13 18:51:50', 0);
